import React from 'react';
import ReactDOM from 'react-dom'; // For React 17 and earlier
// import { createRoot } from 'react-dom/client'; // For React 18

import App from './App';

// For React 17 and earlier:
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

